    render() {
        return (
            <>
                <div className="footer">
                    <div className='part'>
                        <p>© 2020 Cuarentena Covid-19.</p>
                        <p>Todos los derechos reservados.</p>
                        <p>Nit: 00.000.757-3</p>
                        <p>Linea Gratuita PQRs: 000000000000</p>
                        <p>contacto@unicovid.co</p>
                        <p>notificacionesjudiciales@unicovid.co</p>
                        <p>Políticas de Privacidad y Términos de Uso.</p>
                    </div>
                    <div className='part'>
                        <p>Barcelona: Km. 12 Vía Puerto López - PBX. +57 (8) 6616800</p>
                        <p>San Antonio: Calle 37 No. 41-02 Barzal - PBX. +57 (8) 6616900</p>
                        <p>Emporio: Calle 40 A No. 28-32 Emporio - +57 (8) 6734700</p>
                        <p>Fax: +57 (8) 6616800 ext: 204</p>
                        <p>Horario de atención: Lunes a Viernes</p>
                        <p>7:30am a 11:45m y 2:00pm a 5:30pm</p>
                    </div>
                    <div className='part'>

                    </div>
                </div>
                <style jsx>{`
            .footer {
                position: fixed;
                left: 0;
                bottom: 0;
                width: 100%;
                height: 25%;
                background: black;
                color: white;
                justify-content: center;
                align-items: center;
                display: flex;
                flex-wrap: wrap;
             }

             .part{
                 width: 20%;
                 height: 80%;
                 border: 1px solid white;
                 margin: 5px;
                 font-size: 1rem;
             }

             .part p{
                 margin: 0
             }
        `}</style>
            </>
        );
    }
